import React from 'react';
import '../hoja-de-estilos/Card.css';

function Card({ max, min, name, img, onClose }) {
  // acá va tu código
  return (
    <div class="flip-card">
      <div class="flip-card-inner">
        <div class="flip-card-back">
          <img src={img} />
        </div>
        <div class="flip-card-front">
          <img src={img} />
          <h3>{name}</h3>
          <h2>{`Min: ${min}`}</h2>
          <h2>{`Max: ${max}`}</h2>
        </div>
      </div>
    </div>
  );
}

export default Card;

